import React, { Component } from 'react';
class Header extends Component {


    render() {
        return (

            <div className="header">
                <div class="container">

                    <div className="row">
                        <div class="col-sm header">
                            <h1>James Bond Shop</h1>
                        </div>


                    </div>
                </div>
            </div>
        )
    }
}
export default Header;
